import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import { Home } from "./views/Home";
import SearchGames from "./components/SearchGames"; // Agregamos la importación

function App() {
  return (
    <Router>
      <div className="App">
        <header>
          <Navbar />
        </header>
        <main>
          <Routes>
            <Route path="/" element={<Home />} />
            {/* Agregamos la ruta para el componente SearchGames */}
            <Route path="/search" element={<SearchGames />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
